function loadJs(r){if(0==r.Length){console.error("Invalid source URL");return}let e=document.createElement("script");e.src=r,e.type="text/javascript",e.onload=function(){console.log("Script loaded successfully")},e.onerror=function(){console.error("Failed to load script")},document.body.appendChild(e)}function loadJsById(r,e){0==e.Length&&console.error("Invalid source URL");let o=document.createElement("script");o.src=e,o.type="text/javascript",o.id=r,o.onload=function(){console.log("Script loaded successfully")},o.onerror=function(){console.error("Failed to load script")},document.body.appendChild(o)}